import React from 'react';
import './Signup.css';


 const Signup = (props) => {
    let Signupdetails=false;
    let details=null;
    const showsignup = () => {
        Signupdetails=!Signupdetails;
      } 

    
    return (
        <div >
         <h1>MY dude</h1>
         <button type="button" onClick={showsignup} >Signup</button>
        </div>
       
    );

}
 
export default Signup;
